sys_variable_value.value:
(function execute(inputs, outputs) {
    var newName = inputs.itemName.toString();
    
    newName = newName.replace('{program name support}', inputs.productName);
    newName = newName.replace('{program name deliver}', inputs.productName);

    outputs.new_name = newName;
})(inputs, outputs);

